import logo from './logo.svg';
import './App.css';
import "bootstrap/dist/css/bootstrap.min.css";
import { Button } from 'reactstrap';
import { Component } from 'react';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      colores: Array(5).fill('secondary')
    };
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <div>
            <Button color={this.state.colores[0]}>a</Button>
            <Button color={this.state.colores[1]}>a</Button>
            <Button color={this.state.colores[2]}>a</Button>
            <Button color={this.state.colores[3]}>a</Button>
            <Button color={this.state.colores[4]}>a</Button>
          </div>
        </header>
      </div>
    );
  }
}

export default App;
